import React, { useState } from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';

const Profile = ({ userInfo, handleLogout }) => {
    // const [selectedFile, setSelectedFile] = useState(null);
    const [previewImage, setPreviewImage] = useState("../../images/faces/face28.jpg"); // Default profile image

    const handleFileChange = async (event) => {
        const file = event.target.files[0];

        // Update selected file and preview image immediately
        // setSelectedFile(file);
        const reader = new FileReader();
        reader.onloadend = () => {
            setPreviewImage(reader.result);
        };
        reader.readAsDataURL(file);

        // Prepare form data for file upload
        const formData = new FormData();
        formData.append('profileImage', file);

        // Upload file to server
        try {
            const response = await fetch('/ProfileUpload', {
                method: 'POST',
                body: formData,
            });
            if (!response.ok) {
                throw new Error('Upload failed');
            }
            const data = await response.json();
            console.log('Upload success:', data);
            // Update profile image URL after successful upload
            setPreviewImage(data.imageUrl); // Assuming the server sends back the URL of the uploaded image
        } catch (error) {
            console.error('Upload failed:', error);
            // Optionally handle upload failure here (e.g., show error message)
        }
    };

    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Profile</h3>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="col-md-8 grid-margin stretch-card">
                                    <div className="card">
                                        <div className="row" style={{display: 'flex', justifyContent: 'center'}}>
                                            <div className="col-md-7">
                                                <div className="card-body">
                                                    <form className="forms-sample">
                                                        <div className="form-group">
                                                            <label for="exampleInputUsername1">Username</label>
                                                            <input type="text" className="form-control" id="exampleInputUsername1" placeholder="Username"/>
                                                        </div>
                                                        <div className="form-group">
                                                            <label for="exampleInputEmail1">Email address</label>
                                                            <input type="email" className="form-control" id="exampleInputEmail1" placeholder="Email"/>
                                                        </div>
                                                        <div className="form-group">
                                                            <label for="exampleInputPassword1">Password</label>
                                                            <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password"/>
                                                        </div>
                                                        <div style={{display: 'flex', justifyContent: 'center'}}>
                                                            <button type="submit" className="btn btn-primary mr-2">Submit</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div> 
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-4 grid-margin stretch-card">
                                    <div className="card">
                                        <div className="card-body">
                                            <div style={{ display: 'flex', justifyContent: 'center', marginTop:'15%', }}>
                                               <img src={previewImage} alt="profile" style={{width:'70%', height:'70%'}}/>
                                            </div>
                                            <div style={{ display: 'flex', justifyContent: 'center' }}>
                                                <div className="template-demo">
                                                    <label htmlFor="file-upload" className="btn btn-primary btn-md "> Change Photo </label>
                                                    <input id="file-upload" type="file" style={{ display: 'none' }} onChange={handleFileChange} accept="image/*" />                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default Profile
